import React from "react";
import { Heading } from "@chakra-ui/react";
import styles from "./heading.module.css";

const Title = ({ text, user, logo }) => {
  return (
    <Heading className={styles.container}>
      {text} {logo} {user}
    </Heading>
  );
};

export default Title;
